create database ru_amazon;
use ru_amazon;


/*Stores user variables in the database (account sign up information) */
create table users (
	uname varchar(100) primary key,
    upwd varchar(12),
    uemail varchar(100), 
    acct_type varchar(6) default 'end', 
    major varchar(100) default 'none', 
    last_login datetime default now()
);
select * from users;

/*making the admin user*/
INSERT INTO users VALUES ("admin", "adminpass", "admin@gmail.com","admin","unaffiliated", now());

/*making the representatives */
INSERT INTO users VALUES ("rep1", "reppass", "rep1@gmail.com","rep","unaffiliated", now());

/*making the table for the broad range of products */
create table items(
	item_id int Default 0,
    prod_name varchar(50) DEFAULT NULL,
    prod_loc varchar(40), 
    product_desc varchar(400), 
	PRIMARY KEY(item_id)
);

/*Main table for products */
create table products(
item_id int primary key default 0,
prod_type varchar(30),
prod_color varchar(20),
delivery bool default null,
prod_condition varchar(30) default null,
photo mediumblob,
Constraint item_id Foreign Key(item_id) references items(item_id) On delete cascade


);

/*Main table for services */

create table services(
	item_id int primary key default 0,
    course_subject varchar(30), 
    service_charge int Default 0, 
    qualifications varchar(3000), 
	Constraint service_item_id Foreign Key(item_id) references items(item_id) On delete cascade
);


DROP TABLE IF EXISTS `course_groupme_chats`;
