CREATE TABLE IF NOT EXISTS listings (
  seller varchar(30) NOT NULL DEFAULT '',
  item_id int DEFAULT 0,
  current_price decimal(9,2) DEFAULT NULL,
  PRIMARY KEY(item_id),
  CONSTRAINT fk_itemid_items FOREIGN KEY(item_id) references items(item_id),
  CONSTRAINT fk_seller_items FOREIGN KEY(seller) references users(uname) ON UPDATE CASCADE ON DELETE CASCADE);
  

Create table if not exists addresses(
uname varchar(100) not null default '',
Street varchar(300),
City varchar(200), 
Apt varchar(50), 
instructions varchar (300),
CONSTRAINT fk_buyer_addy FOREIGN KEY(uname) references users(uname) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS alerts (
  uname varchar(30) NOT NULL DEFAULT '',
  alert_message varchar(100) NOT NULL DEFAULT '', 
  CONSTRAINT fk_alerts FOREIGN KEY(uname) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE
  );
  



CREATE TABLE IF NOT EXISTS Questions (
  cust_user varchar(30) NOT NULL DEFAULT '',
  rep_user varchar(30) NOT NULL DEFAULT '',
  date datetime NOT NULL,
  question varchar(200) DEFAULT NULL,
  answer varchar(200) DEFAULT NULL,
  PRIMARY KEY(cust_user,rep_user,date),
  CONSTRAINT fk_ask_customer FOREIGN KEY(cust_user) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_ask_representative FOREIGN KEY(rep_user) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE);




CREATE TABLE IF NOT EXISTS offerOn (
  uname varchar(30) NOT NULL,
  item_id int DEFAULT 0,
  date datetime NOT NULL,
  amount decimal(9, 2) DEFAULT 0,
  PRIMARY KEY(uname,item_id,amount),
  CONSTRAINT fk_offerOn_user FOREIGN KEY(uname) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE ,
  CONSTRAINT fk_offerOn_auction FOREIGN KEY(item_id) REFERENCES listings(item_id) ON DELETE CASCADE);

  select seller, prod_name, current_price from listings natural join items where item_id=1;
  select max(item_id) highest from listings;
  select * from items;
  select * from users;
  
CREATE TABLE IF NOT EXISTS sold (	
  seller varchar(30) NOT NULL DEFAULT '',
  buyer varchar(30) NOT NULL DEFAULT '',
  item_id int DEFAULT 0,
  final_price decimal(9,2) DEFAULT NULL,
  PRIMARY KEY(seller,item_id),
  CONSTRAINT fk_sold_seller FOREIGN KEY(seller) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE,
  CONSTRAINT fk_sold_buyer FOREIGN KEY(buyer) REFERENCES users(uname) ON UPDATE CASCADE ON DELETE CASCADE);
  
  
